import React, { Component } from 'react'
import { Link } from 'react-router-dom'
import { connect } from 'react-redux';
import { legalPrivate } from "../redux/countersAC";
import BigLogo from './logo/BigLogo'

import '../css/allmystyle.css'

class EndReg extends Component {

    toFiz(){
        this.props.dispatch(legalPrivate(true ,"/regFiz"))
    }
    toJyr(){
        this.props.dispatch(legalPrivate(false ,"/registrationOfLegalEntities"))
    }



    render() {
        return (
            <div className="wrapper">
                <BigLogo />
                <div className="forform ">
                    <div className="textUndrerJT "><span>Для завершения регистрации,<br />внесите недостающие данные</span></div>
                    <div className="textUndrerJT "><span>Выберите тип пользователя</span></div>
                    <div className="button-big-my">
                        <div className="div-column-my">

                             <Link to={{ pathname: 'regOne' }} onClick={this.toFiz.bind(this)} className="colorWhite" ><button type="submit" value="физлиц" className="button-my button-big-my button-red">Физическое лицо</button></Link>
                            <Link to={{ pathname: 'regOne' }} onClick={this.toJyr.bind(this)} className="colorWhite"><button type="submit" value="юрлиц" className="button-my button-big-my button-red">Юридическое лицо</button></Link>
                        </div>
                    </div>
                </div >
            </div>
        )
    }

}

const mapStateToProps = function (state) {
    // console.log(state.counter, "EndReg")
    return {
        // из раздела Redux с именем counter свойство cnt будет доступно
        // данному компоненту как this.props.cnt
        cnt: state.store.cnt,
    };
};

// присоединяем (connect) компонент к хранилищу Redux
export default connect(mapStateToProps)(EndReg);
